import {
  AreaChart,
  Area,
  CartesianGrid,
  XAxis,
  YAxis,
  Tooltip,
} from "recharts";

const data = [
  {
    totalStorage: "110",
    date: "2020-07-02"
  },
  {
    totalStorage: "120",
    date: "2020-07-03"
  },
  {
    totalStorage: "160",
    date: "2020-07-04"
  },
  {
    totalStorage: "170",
    date: "2020-07-05"
  },
  {
    totalStorage: "223",
    date: "2020-07-06"
  },
  {
    totalStorage: "220",
    date: "2020-07-07"
  },
  {
    totalStorage: "90",
    date: "2020-07-08"
  },
];

const renderLineChart = (
  <AreaChart width={700} height={300} data={data}>
    <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
    <YAxis />
    <XAxis />
    <Area type="monotone" dataKey="totalStorage" stroke="#9A00D7" fill='#CF86FA' strokeWidth={2} />
  </AreaChart>
);

export const TotalStorageArea = () => {
  return (
    <>
      <div style={{marginLeft: "5rem"}}>      
        <h2>Network Capacity</h2>
        <div>{renderLineChart}</div>
      </div>
    </>
  );
}

export default TotalStorageArea;
